import logo from './logo.svg';
import './App.css';


const Header = () => {
  return <h2>Hello za warudo!</h2>
} 

const Field = () => {
  return <input placeholder='Type here' type='text'/>
}

function Btn() {


  const text = 'Log in';
  const logged = false;
  return <button>{logged ? 'Enter' : text}</button>
}

function App() {
  return (
    <div className="App">
      <Header />
      <Field />
      <Btn />
    </div>
  );
}

export default App;
